/* eslint-disable no-unused-vars */
import React, { lazy, Suspense } from "react";
import { Routes, Route } from "react-router-dom";

const Login = lazy(() => import("./pages/login"));

function App() {
  return (
    <Routes>
      <Route path="/login" component />
    </Routes>
  );
}

export default App;
